import React, { useState, useEffect } from "react";
import axios from "axios";

const TodoList = () => {
  const [list, setList] = useState([]);

  useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios
      .get("https://jsonplaceholder.typicode.com/posts")
      .then((res) => {
        console.log("res: ", res);
        setList(res.data);
      })
      .catch((err) => {
        console.log("err: ", err);
      });
  };
  return (
    <div>
      <ul>
        {list.map((item, idx) => (
          <li key={idx}>{item.id}</li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
